      | 48335 -> { ItemTypeData.id= 48335; name= "4-EFLU Station Monument"; published= false; description= "On this spot once stood an outpost built by the French-speaking alliance, Tau Ceti Federation. Though they would disband by YC112 the alliance's goal was to unite all the French-speaking people of New Eden under a single banner. When they disbanded 4-EFLU the outpost passed from hand to hand until it was eventually conquered by STARCHASER Alliance before being decommissioned."; marketGroupId= None; groupId= 1998; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 161; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 162; value= 1500.000000 }; { DogmaAttributeValueData.attributeId = 2787; value= 99007498.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 9; value= 100000000.000000 } |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= Some(3822); mass= 0.000000; packagedVolume= 0.000000; portionSize= 1; radius= 1500.000000; volume= 0.000000 } |> Some
      | 48432 -> { ItemTypeData.id= 48432; name= "Decayed Medium Cap Battery Mutaplasmid"; published= true; description= "This bioadaptive mutaplasmid tool is designed to interface with and alter devices that provide additional capacitor storage. As such this mutaplasmid could be used to mutate the performance characteristics of capacitor battery modules in the correct size class.    Triglavian bioadaptive technology makes extensive use of engineered colonies of extremophilic bacteria, that are used to grow, harvest and adapt various resources found in Abyssal Deadspace. Artificial colonizing plasmids integrated into specialist tools used for direct adaptation of technology can be found in Triglavian caches in various stages of development. These mutaplasmids can be used to alter the characteristics of a wide variety of equipment types, depending on the strain and the bioadaptive tool with which they are integrated.    The mutaplasmid colony integrated into this bioadaptive tool has begun to decay and mutation effects will be less pronounced as a result. While possible mutational benefits are low, the risks of using this mutaplasmid are also reduced."; marketGroupId= Some(2454); groupId= 1964; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 1.000000; packagedVolume= 1.000000; portionSize= 1; radius= 1.000000; volume= 1.000000 } |> Some
