      | 54446 -> { ItemTypeData.id= 54446; name= "Thorax Permaband Roadies SKIN"; published= true; description= "Pioneers of the  Thukk Rokk  musical subculture, the members of Permaband have been touring far and wide across New Eden for decades. The group always puts on epic spectaculars at its sell-out concerts, often involving truly astounding amounts of pyrotechnics and bizarre stunts. Many roadies are employed on the crew of Permaband, and they travel across New Eden along with the equipment and ships of the Thukk Rokk superstars.    With its roots in the nomadic Thukker Tribe serving it well on tour, the band has become something of an institution on the capsuleer music scene, playing to the spaceship pilot elite at their exclusive gatherings around the world of New Eden."; marketGroupId= Some(1992); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
